    "edwin-b-forsythe-national-wildlife-refuge-a-report-on-wilderness-character-monitoring-draf",nt"isopen":
    false,nt"url": null,nt"notes": "Edwin B. Forsythe National Wildlife Refuge
    (EBFNWR) contains some of the most important migratory bird habitat in the National
    Wildlife Refuge System. The approach provided herein follows wilderness character
    monitoring guidance developed by an interagency team, representing the U.S. Fish
    & Wildlife Service (USFWS), National Park Service (NPS), U.S. Forest Service (USFS),
    and Bureau of Land Management (BLM). This document describes a wilderness character
    monitoring program for Brigantine National Wilderness Area. Field surveys, refuge
    management policies, and documented uses are incorporated into this guide for managers
    and future monitoring efforts. Additionally, comments from former and current EBFNWR
    staff, other USFWS staff, and other federal agency staff have been incorporated
    into this guide.",nt"license_title": "License Not Specified",nt"extras":
